import classes from "./Certification.module.css";
import reactlogo from "../../../assets/reactlogo.png";

const Certification = () => {
  const openInNewTab = (url) => {
    window.open(url, "_blank", "noopener,noreferrer");
  };

  const certificateHandler = (event) => {
    event.preventDefault();
    openInNewTab("http://localhost:3000/education");
  };

  
  return (
    <div className={classes.certificate}>
      <h2>Certification</h2>
      <div className={classes.firstt}>
        <h3></h3>
        <h4></h4>
      </div>
      <div className={classes.bigBox}>
        <div className={classes.rightBox}>
          <img src={reactlogo} />
          <div
            onClick={certificateHandler}
            className={classes.rightBox__overlay}
          >
            <p>CERTIFICATE</p>
          </div>
        </div>
        <div className={classes.leftBox}>
          <h3>React - The Complete Guide</h3>
          <h4> - Maximilian Schwarzmüller</h4>
        </div>
      </div>
      <div className={classes.bigBox_2}>
        <div className={classes.rightBox_2}>
          <img src={reactlogo} />
        </div>
        <div className={classes.leftBox_2}>
          <h3>React - The Complete Guide</h3>
          <h4> - Maximilian Schwarzmüller</h4>
        </div>
      </div>
    </div>
  );
};

export default Certification;
